import React, { App }  from 'react';
import { artworks } from "../data";

export default function Gallery() {
  return (
      <div>
        {artworks.map((artwork) => (
        <div className="project-title">
          <img
          alt={artwork.title}
          src={artwork.image}
          />
          <h3 class="text-blue-400">
            {artwork.title}, {artwork.media[0]}
          </h3>
          <p>
            {artwork.description}
          </p>

        </div>
        ))}
      </div>

  );
}
